import "./App.css";
import React, { useState } from "react";
import Parent from "./components/Parent";

function App() {
  const [count, setCounter] = React.useState(0);

  return (
    <div>
      <h2>Counter: {count}</h2>
      <button onClick={() => setCounter((prevCount) => prevCount + 1)}>
        Increment
      </button>
      <button onClick={() => setCounter((prevCount) => prevCount - 1)}>
        Decrement
      </button>
    </div>
  );
}

export default App;
